import React, {Component} from 'react';
import StudiesService from "../services/DicomService";
import SearchBar from "../components/SearchBar";
import StudySeriesTable from "../components/StudySeriesTable";

class StudySeriesPage extends Component{
    constructor(props) {
        super(props);
        this.state = {
            study: {},
            studyId: props.match.params.id,
            filterText:'',//搜索时用的过滤词语
        };
        this.setState.bind(this);
    }

    //更新过滤词
    handelFilter = (filterText) => {
        this.setState({
            filterText:filterText
        });
    };

    componentWillMount() {
        console.log("开始");
        StudiesService.findStudyById(this.state.studyId, study => {
            this.setState({study: study});
            console.log("这里可以")
        });
    }

    render(){
        const study = this.state.study;
        return (
            <div>
                <h1>单个study</h1>
                <p>输入study ID关键字进行检索</p >
                <SearchBar 
                filterText={this.state.filterText}
                onFilterChange={this.handelFilter} placeholder="Search"/>
                <StudySeriesTable study={study} 
                filterText={this.state.filterText}/>
            </div>            
        );
    }
}
export default StudySeriesPage;
